import React from "react";

const NavMenuTop = () => {
  return (
    <nav className="topnav">
      <div className="container">
        <div className="row">
          <div className="col-12 col-sm-12 col-md-12 col-lg-9 col-xl-10"></div>
          <div className="col-12 col-sm-12 col-md-12 col-lg-3 col-xl-2 topnav_cart"></div>
        </div>
      </div>
    </nav>
  );
};

export default NavMenuTop;
